import React, { useState } from 'react'

import AppBar from './AppBar'

const App = (props) => {
  const [path, setPath] = useState(props.url.location.pathname)

  props.url.listen((location) => {
    return setPath(location.pathname)
  })

  return (
    <section className='App'>
      <AppBar />
    </section>
  );
}

export default App;
